;‘Erased Dreams’, the first full-length, low-tempo project from Helsinki based artist Yotto.logseq____&quot;,536870977]],[logseq____&quot;^15logseq____&quot;,[2002,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870977]],[logseq____&quot;^15logseq____&quot;,[2002,logseq____&quot;^Flogseq____&quot;,210,536870977]],[logseq____&quot;^15logseq____&quot;,[2002,logseq____&quot;^Xlogseq____&quot;,210,536870977]],[logseq____&quot;^15logseq____&quot;,[2002,logseq____&quot;^Vlogseq____&quot;,210,536870977]],[logseq____&quot;^15logseq____&quot;,[2002,logseq____&quot;^Ulogseq____&quot;,210,536870977]],[logseq____&quot;^15logseq____&quot;,[2002,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u67526dc5-9ec5-477b-96b0-c4bebab1f102logseq____&quot;,536870977]],[logseq____&quot;^15logseq____&quot;,[2003,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;Aptly regarded as a man of many sounds by Billboard, Yotto’s ‘Erased Dreams’ also marks Reflections’ debut LP release; an 8 track ambient journey, revealing a new side to one of Anjuna’s most illustrious producers. Well-known for his thunderous DJ sets and deep, bass-heavy house productions, ‘Erased Dreams’ may seem like a departure from Yotto’s usual style, but he’s always made music like this. With Reflections, he finally found a home for it.logseq____&quot;,536870977]],[logseq____&quot;^15logseq____&quot;,[2003,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870977]],[logseq____&quot;^15logseq____&quot;,[2003,logseq____&quot;^Flogseq____&quot;,2002,536870977]],[logseq____&quot;^15logseq____&quot;,[2003,logseq____&quot;^Xlogseq____&quot;,210,536870977]],[logseq____&quot;^15logseq____&quot;,[2003,logseq____&quot;^Vlogseq____&quot;,210,536870977]],[logseq____&quot;^15logseq____&quot;,[2003,logseq____&quot;^Ulogseq____&quot;,210,536870977]],[logseq____&quot;^15logseq____&quot;,[2003,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u67526dc5-0123-40b5-9b97-ad34ead38294logseq____&quot;,536870977]],[logseq____&quot;^15logseq____&quot;,[2004,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;Throughout his sparkling career, which includes a Billboard #1 LP and remixes of tracks by Joris Voorn, Gorillaz and Coldplay, Yotto has produced ambient music to help him look inward and re-charge his creative battery. But when COVID hit, his inner world took over. “At first, I was being really productive with club music. But then after a while I started making something completely opposite.” Yotto found himself exploring a different form of expression, with no plan other than to create. But when he put the tracks side-by-side in a playlist he recognised a synergy, and the outline of the project began to take shape. The result is more of a continuous soundscape than an album; an ethereal and dreamy experience designed to accompany the listener as they turn inward and drift away. If club music is a form of escape, then this is too – but instead of turning outward, we lose ourselves inward.logseq____&quot;,536870977]],[logseq____&quot;^15logseq____&quot;,[2004,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870977]],[logseq____&quot;^15logseq____&quot;,[2004,logseq____&quot;^Flogseq____&quot;,2003,536870977]],[logseq____&quot;^15logseq____&quot;,[2004,logseq____&quot;^Xlogseq____&quot;,210,536870977]],[logseq____&quot;^15logseq____&quot;,[2004,logseq____&quot;^Vlogseq____&quot;,210,536870977]],[logseq____&quot;^15logseq____&quot;,[2004,logseq____&quot;^Ulogseq____&quot;,210,536870977]],[logseq____&quot;^15logseq____&quot;,[2004,logseq____&quot;^Ulogseq____&quot;,2001,536870977]],[logseq____&quot;^15logseq____&quot;,[2004,logseq____&quot;^Hlogseq____&quot;,2001,536870977]],[logseq____&quot;^15logseq____&quot;,[2004,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u67526dc5-0be2-4ebe-a4c7-53a5b7bf5476logseq____&quot;,536870977]],[logseq____&quot;^15logseq____&quot;,[2005,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;The first single is ‘Silhouette’. It’s a melancholy, atmospheric track with hints of ’80s nostalgia and smooth as glass vocals from Sansa. The track conjures up images of vast and endless landscapes; the sense of space enhanced by sparse chord-changes and field recordings of heavy rain. ‘Silhouette’ is so human it feels like an extension of an emotion, and Yotto says the idea came to him like a dream. A sound drifted towards him one day and he caught it by the tail and built on top of it until it became the entity he envisioned. ’It’s slow and steady and it grows. I think the beauty lies in the simplicity of it.”logseq____&quot;,536870977]],[logseq____&quot;^15logseq____&quot;,[2005,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870977]],[logseq____&quot;^15logseq____&quot;,[2005,logseq____&quot;^Flogseq____&quot;,2004,536870977]],[logseq____&quot;^15logseq____&quot;,[2005,logseq____&quot;^Xlogseq____&quot;,210,536870977]],[logseq____&quot;^15logseq____&quot;,[2005,logseq____&quot;^Vlogseq____&quot;,210,536870977]],[logseq____&quot;^15logseq____&quot;,[2005,logseq____&quot;^Ulogseq____&quot;,210,536870977]],[logseq____&quot;^15logseq____&quot;,[2005,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u67526dc5-eec9-4346-a55d-f0b2f1373095logseq____&quot;,536870977]],[logseq____&quot;^15logseq____&quot;,[2006,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;Club music will always be at the core of Yotto’s work, but his ambient catalogue will no longer sit in the shadows. Together, these parallel forms of expression don’t dilute Yotto’s artistry; they make it even stronger.logseq____&quot;,536870977]],[logseq____&quot;^15logseq____&quot;,[2006,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870977]],[logseq____&quot;^15logseq____&quot;,[2006,logseq____&quot;^Flogseq____&quot;,2005,536870977]],[logseq____&quot;^15logseq____&quot;,[2006,logseq____&quot;^Xlogseq____&quot;,210,536870977]],[logseq____&quot;^15logseq____&quot;,[       // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
